import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
<h1>File Upload Service</h1>
<form>
  <label>Title</label>
  <input name='title' type='text'></input>
  <label>Date</label>
  <input name='date' type='text'></input>
  <label>Reference</label>

</form>
    </div>
  );
}

export default App;
